<h2><a name='sect2' href='#toc2'>C]pmix_wrapper [options]R]Description</a></h2>
<p>
C]pmix_wrapperR] is not meant to be
called directly by end users.
<dl>

<dt>It is automatically invoked as the back-end
by the PMIx wrapper command </dt>
<dd>C]mpicc.R] </dd>
</dl>
<p>
Some PMIx installations may have
additional wrapper commands, and/or have renamed the wrapper compilers
listed above to avoid executable name conflicts with other PMIx implementations.

